import React from "react";

import "./forum.style.scss";

const Forum = () => {
  return (
      <div className='forum'>
          <div className='forum-text'>

      <br/>
      <h4 className='alert'>
                  COMING <span>SOON</span>!!!

      </h4>
          </div>
    </div>
  );
};

export default Forum;
